import React from 'react'
import myimage from '../Images/community.png';

export default function Aboutus() {
  return (
    <div className='aboutUsMainDiv d-flex row'>
      <div className='col-6'>
        <img src={myimage} alt="" />
      </div>
      <div className='col-6'></div>
    </div>
  )
}
